// import React from 'react'
import "../fonts/style.css"
// import React from 'react'
import { Link } from 'react-router-dom';
import React, { useState } from 'react';
import '../css/navbar.css'; // Import your custom styles
import '../fonts/icomoon/style.css';

const Navbar = () => {
  const [isMenuOpen, setMenuOpen] = useState(false);

  const handleMenuClick = () => {
    setMenuOpen(!isMenuOpen);
  };

  const menuStyle = {
    display: isMenuOpen ? 'flex' : 'none',
    top: isMenuOpen ? '0' : '-150%',
  };

  return (
    <>
      <div className="site-mobile-menu site-navbar-target">
        <div className="site-mobile-menu-header">
          <div className="site-mobile-menu-close mt-3">
            <span className="icon-close2 js-menu-toggle" />
          </div>
        </div>
        <div className="site-mobile-menu-body" />
      </div>

      <div className="site-navbar-wrap">
        <div className="site-navbar-top">
          <div className="container py-3">
            <div className="row align-items-center">
              <div className="col-6">
                <div className="d-flex mr-auto">
                  <a href="#" className="d-flex align-items-center mr-4">
                    <span className="icon-envelope mr-2" />
                    <span className="d-none d-md-inline-block">info@domain.com</span>
                  </a>
                  <a href="#" className="d-flex align-items-center mr-auto">
                    <span className="icon-phone mr-2" />
                    <span className="d-none d-md-inline-block">+1 234 4567 8910</span>
                  </a>
                </div>
              </div>
              <div className="col-6 text-right">
                <div className="mr-auto">
                  <a href="#" className="p-2 pl-0">
                    <span className="icon-twitter" />
                  </a>
                  <a href="#" className="p-2 pl-0">
                    <span className="icon-facebook" />
                  </a>
                  <a href="#" className="p-2 pl-0">
                    <span className="icon-linkedin" />
                  </a>
                  <a href="#" className="p-2 pl-0">
                    <span className="icon-instagram" />
                  </a>
                </div>
              </div>
            </div>
          </div>
        </div>

        <div
          id="sticky-wrapper"
          className={`site-navbar site-navbar-target js-sticky-header sticky-wrapper ${
            isMenuOpen ? 'menu-open' : ''
          }`}
          style={{ height: '69.2188px', ...menuStyle }}
        >
          <div className="container">
            <div className="row align-items-center">
              <div className="col-2">
                <h1 className="my-0 site-logo">
                  <a href="index.html">Brand</a>
                </h1>
              </div>
              <div className="col-10">
                <nav className="site-navigation text-right" role="navigation">
                  <div className="container">
                    <div className="d-inline-block d-lg-none ml-md-0 mr-auto py-3">
                      <a
                        href="#"
                        className="site-menu-toggle js-menu-toggle text-white"
                      >
                        <span className="icon-menu h3" />
                      </a>
                    </div>
                    <div className="openMenu" onClick={handleMenuClick}>
                      <i className="fa fa-bars" />
                    </div>
                    <ul
                      className={`site-menu main-menu js-clone-nav d-none d-lg-block ${
                        isMenuOpen ? 'menu-open' : ''
                      }`}
                      style={menuStyle}
                    >
                      <li className="active">
                        <Link to="/">Home</Link>
                      </li>
                      {/* ... (your existing code for navigation links) */}
                    </ul>
                  </div>
                </nav>
              </div>
            </div>
          </div>
        </div>
      </div>
    </>
  );
};

export default Navbar;




